script: |
  super -f text -I q3186.spq | sort > q3186.out

inputs:
  - name: q3186.spq
    data: |
      SELECT DISTINCT + 88 + cor0.col0 / tab1.col1 AS col2 FROM tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab1

outputs:
  - name: q3186.out
    data: |
      88
      89
      90
      91
      94
      96
